<section class="benefits section">
  <div class="section-header">
    <h2 class="section-header__title">Benefits</h2>
    <p class="section-header__lead">Why i am cool to work with</p>
  </div>
  <div class="benefits__container">
    <div class="benefits__tabs" role="tablist">
      <div class="benefits__tab active" data-toggle="tab" href="#producers-benefits">
        <div class="benefits__tab-icon">
          <img src="data:image/png;base64,"
            srcset="/media/benefits-producers@2x.png 2x">
        </div>
        <div class="benefits__tab-title">Producers</div>
      </div>
      <div class="benefits__tab" data-toggle="tab" href="#financiers-benefits">
        <div class="benefits__tab-icon">
          <img src="data:image/png;base64,"
            srcset="/media/benefits-financiers@2x.png 2x">
        </div>
        <div class="benefits__tab-title">Financiers</div>
      </div>
      <div class="benefits__tab" data-toggle="tab" href="#distributors-benefits">
        <div class="benefits__tab-icon">
          <img src="data:image/png;base64,"
            srcset="data:image/png;base64, 2x">
        </div>
        <div class="benefits__tab-title">Distributors</div>
      </div>
    </div>
    <div class="benefits__tab-content">
      <div class="tab-pane active" id="producers-benefits">
        <ul class="benefits__list">
          <li class="benefits__item">
            <div class="benefits__item-title">Easy</div>
            <div class="benefits__item-text">Go through only
              <br>3 steps to submit
              <br>your project
            </div>
          </li>
          <li class="benefits__item">
            <div class="benefits__item-title">Time-Saving</div>
            <div class="benefits__item-text">You reach multiple
              <br>financiers and buyers
            </div>
          </li>
          <li class="benefits__item">
            <div class="benefits__item-title">Money-wise</div>
            <div class="benefits__item-text">No submission fees.
              <br>Fast and effective
              <br>financing.
            </div>
          </li>
        </ul>
      </div>
      <div class="tab-pane" id="financiers-benefits">
        <ul class="benefits__list">
          <li class="benefits__item">
            <div class="benefits__item-title">Hedge</div>
            <div class="benefits__item-text">You receive only carefully
              <br>filtered projects that
              <br>will give you return.
            </div>
          </li>
          <li class="benefits__item">
            <div class="benefits__item-title">Simple</div>
            <div class="benefits__item-text">A few steps to
              <br>register your profile
              <br>and goals
            </div>
          </li>
          <li class="benefits__item">
            <div class="benefits__item-title">Security</div>
            <div class="benefits__item-text">No interaction with producers
              <br>is needed. No registration
              <br>fees paid.
            </div>
          </li>
        </ul>
      </div>
      <div class="tab-pane" id="distributors-benefits">
        <ul class="benefits__list">
          <li class="benefits__item">
            <div class="benefits__item-title">Time-Saving</div>
            <div class="benefits__item-text">You recieve only carefully
              <br>filtered and commercially
              <br>viable projects
            </div>
          </li>
          <li class="benefits__item">
            <div class="benefits__item-title">Easy</div>
            <div class="benefits__item-text">A few clicks registration
              <br>and full projects
              <br>overview
            </div>
          </li>
          <li class="benefits__item">
            <div class="benefits__item-title">Cashflow</div>
            <div class="benefits__item-text">Our business model
              <br> facilitates your cashflow
              <br> needs
            </div>
          </li>
        </ul>
      </div>
    </div>
  </div>
  <div class="benefits__bg">
    <img src="data:image/png;base64,"
      srcset="data:image/png;base64, 2x">
  </div>
</section>
